import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Login from "./components/LoginForm";
import Register from "./components/RegisterForm";
import UserDashboard from "./components/UserDashboard";
import AdminDashboard from "./components/AdminDashboard";
import FileHistoryLog from "./components/FileHistoryLog";
import UploadPage from "./components/UploadPage";
import UsersPage from "./components/UsersPage";
import SystemPage from "./components/SystemPage";

function App() {
  // Restore user session from localStorage if present
  const [user, setUser] = useState(() => {
    const savedUser = localStorage.getItem("user");
    return savedUser ? JSON.parse(savedUser) : null;
  });

  const [loading, setLoading] = useState(false);

  // Simulated backend authentication API (replace with real one later)
  const fakeAuthApi = (credentials) =>
    new Promise((resolve, reject) => {
      setTimeout(() => {
        const { email, password } = credentials;
        if (!email || !password) return reject("Missing credentials");

        // Simple mock: detect admin or user by email
        if (email.toLowerCase().includes("admin")) {
          resolve({ name: "Admin", role: "admin" });
        } else {
          resolve({ name: "User", role: "user" });
        }
      }, 1000);
    });

  // Handle login and set role dynamically
  const handleLogin = async (credentials) => {
    try {
      setLoading(true);
      const loggedInUser = await fakeAuthApi(credentials);
      localStorage.setItem("user", JSON.stringify(loggedInUser));
      setUser(loggedInUser);
    } catch (err) {
      alert(err);
    } finally {
      setLoading(false);
    }
  };

  // Handle logout
  const handleLogout = () => {
    localStorage.removeItem("user");
    setUser(null);
  };

  // Handle demo previews
  const handlePreview = (role) => {
    const demo = {
      name: role === "admin" ? "Admin (preview)" : "User (preview)",
      role,
    };
    localStorage.setItem("user", JSON.stringify(demo));
    setUser(demo);
  };

  return (
    <Router>
      {/* Always visible Navbar */}
      <Navbar user={user} onLogout={handleLogout} onPreview={handlePreview} />

      <main className="p-6 bg-gray-50 min-h-screen">
        {loading ? (
          <div className="text-center py-10 text-gray-600">Authenticating...</div>
        ) : (
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            <Route path="/register" element={<Register />} />

            {/* Protected Routes */}
            {user ? (
              <>
                <Route
                  path="/dashboard"
                  element={
                    user.role === "admin" ? (
                      <AdminDashboard user={user} />
                    ) : (
                      <UserDashboard user={user} />
                    )
                  }
                />
                <Route
                  path="/history"
                  element={<FileHistoryLog user={user} />}
                />
                <Route
                  path="/upload"
                  element={<UploadPage user={user} />}
                />
                <Route
                  path="/users"
                  element={<UsersPage user={user} />}
                />
                <Route
                  path="/system"
                  element={<SystemPage user={user} />}
                />
                <Route path="*" element={<Navigate to="/dashboard" />} />
              </>
            ) : (
              // If not logged in, redirect any other route to home
              <Route path="*" element={<Navigate to="/" />} />
            )}
          </Routes>
        )}
      </main>
    </Router>
  );
}

export default App;
